import React from "react";
import { NavLink } from 'react-router-dom'


const Header = () => (
  <Row>  
    <Navbar className="grey darken-2">
      <li><NavLink to="/">Home</NavLink></li>
	  <li><NavLink to="/">Desafio</NavLink></li>
    </Navbar>
  </Row>
);

export default Header;
